import ReactDOM from "react-dom";

function Sumar(){
  let num1 = 3;
  let num2 = 2;
  var total = (num1 + num2);
  return (
    <div>
      <h1>Tu suma es {total}</h1>
    </div>
  )
}

const rootElement = document.getElementById("root");
ReactDOM.render(<Sumar/>, rootElement);
